import React, { useEffect, useState } from 'react';
import '../styles/fileList.css';

const FileList = () => {
  const [fileList, setFileList] = useState([]);

  useEffect(() => {
    const fetchFiles = async () => {
      try {
        const response = await fetch('http://localhost:5000/images_names');
        if (response.ok) {
          const data = await response.json();
          setFileList(data.images);
        } else {
          console.error('Failed to fetch files:', response.status);
        }
      } catch (error) {
        console.error('Error fetching files:', error);
      }
    };

    fetchFiles();
  }, []);

  return (
    <div>
      <h2>File List:</h2>
      <section className="table-container">
          <div id="table">
            <div className="table-row" id="table-header">
                <div className="header-cell">Fichier</div>
                <div className="header-cell">Catégorie</div>
                <div className="header-cell">Action</div>
            </div>

            <div className="body-row" id="clients-list">
            {fileList.filter((file, index) => index < 10).map((file, index) => (
                <>
                  <div key={index}>{file}</div>
                  <div>Légumes</div>
                  <div></div>
                </>
                ))}
            </div>
          </div>
      </section>
    </div>
  );
};

export default FileList;
